import React from "react";

export default function LastVdo() {
  return (
    <div>
      <div className="vdo">
        <iframe
          width="560"
          height="315"
          src="https://www.youtube.com/embed/qLtSlhDnzFA"
          frameborder="0"
          allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
          allowfullscreen
        ></iframe>
      </div>
      <div className="detail"></div>
    </div>
  );
}
